import React, { useState, createContext, useEffect } from "react";
import Axios from "axios";

export const PlacesContext = createContext();

export const PetPlacesProvider = (props) => {
  const [placesData, setPlacesData] = useState([]);
  const apiUrl = "http://18.216.174.90:3000/api/petplace";
  const token =
    "eyJraWQiOiJqYUh6OTFhVytuUSt4S1Jnd0Rjd1pUV0ZsbW1YUTBtZ0V0ZXVsUFFpTmtZPSIsImFsZyI6IlJTMjU2In0..qE3laVdfceQNTHjnh2ZyvR8kVlBe0bUSge0VNMdFGo9mYxdBZdNTRmRDDs5xJeZlO92yFjWZdm0hbHPu4Le5x_lV1G-1UN03QPEYspPPL7LGmZlrbY4SJW_shWiAI2OsnchdR6n3GOgP29v2ik6eNYZ63UmBJSfvbwNHwtYtGJ5wOb-aLoSKuVPcIVALog8FaOacUvWddDWCrktgNat78AxfyoW1TB_J5Q0FEMCLQYv8jp68eQYAQok2HIBQP0r99CxV-97N6Yt2oJSKOAOgpt_1Ob9AAag1SV3ueExg6mKGdXBNm4o2e5tijrog8vvcn0X0isaE3mcgXS68gjDSDA";

  const config = {
    headers: {
      Authorization: `Bearer ${token}`,
    },
  };
  // const response = Axios.get(apiUrl, config);

  useEffect(() => {
    Axios.get(apiUrl, config).then((response) => setPlacesData(response.data));
  }, []);

  const [addNew, setAddNew] = useState(false);

  const columns = [
    {
      title: "Title",
    },
    {
      title: "Address",
    },
    {
      title: "Longitude",
    },
    {
      title: "Latitude",
    },
    {
      title: "Open Time",
    },
    {
      title: "Close Time",
    },
    {
      title: "Postal Code",
    },
    {
      title: "Category",
    },
    {
      title: "Phone",
    },
    // {
    //   title: "Facebook Link",
    // },
    // {
    //   title: "Instagram Link",
    // },
    // {
    //   title: "Twitter Link",
    // },
    {
      title: "Email",
    },
    {
      title: "URL",
    },
    {
      title: "Action",
    },
  ];

  return (
    <PlacesContext.Provider
      value={{
        addNew: [addNew, setAddNew],
        columns: columns,
        placesData: [placesData, setPlacesData],
      }}
    >
      {props.children}
    </PlacesContext.Provider>
  );
};
